import React from "react";
import { Button, Modal } from "react-bootstrap";
export default class UseModel extends React.Component {
  constructor() {
    super();
    this.state = {
      show: false,
    };
  }
  handelModel() {
    this.setState({ show: true });
  }
  render() {
    return (
      <div>
        <button
          onClick={() => {
            this.handelModel;
          }}
        >
          Click me
        </button>

        <Modal show={true}>
          <Modal.Header>Moda Header</Modal.Header>
          <Modal.Body>Modal Body</Modal.Body>
          <Modal.Footer>
            <Button>Close</Button>
            <Button>Save</Button>
          </Modal.Footer>
        </Modal>
      </div>
    );
  }
}
